using ExamPrototype.Entities;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;

namespace ExamPrototype
{
    public static class MockQuestions
    {
        
        /// <summary>
        /// Get mock questions in multiples of 5 i.e. 5,10,20, 50 etc
        /// </summary>
        /// <param name="noOfQuestions"></param>
        /// <returns></returns>
        public static List<QueAnsVO> GetQuestions(int noOfQuestions = 5, long examID = 1)
        {
            List<QueAnsVO> queAnsList = new List<QueAnsVO>();
            Random randomNumber = new Random();
            int min = 1;
            int max = 9999999;

            for(int i=0;i< noOfQuestions/5; i++)
            {
                // Que 1
                QueAnsVO queAns1 = new QueAnsVO()
                {                    
                    QueID = randomNumber.Next(min, max),
                    Que = "20 + 30 = ?",
                    AnsA = "20",
                    AnsB = "30",
                    AnsC = "40",
                    AnsD = "50",
                    RightAnsEnum = Enums.RightAns.AnsD,
                    RightAnsExplaination = "This is general sumation which give 50 as answer",
                    StudentAnsState = Enums.StudentAnswerState.NotViewedYet
                };
                queAnsList.Add(queAns1);

                // Que 2
                QueAnsVO queAns2 = new QueAnsVO()
                {
                    QueID = randomNumber.Next(min, max),
                    Que = "Which of the following is not equal to watt?",
                    AnsA = "joule/second",
                    AnsB = "ampere x volt",
                    AnsC = "(ampere)<sup>2</sup> x ohm <br />",
                    AnsD = "ampere/ volt",
                    RightAnsEnum = Enums.RightAns.AnsC,
                    RightAnsExplaination = "Watt=Joule/second=Ampere x volt=Ampere<sup>2</sup> x Ohm <br />",
                    StudentAnsState = Enums.StudentAnswerState.NotViewedYet
                };
                queAnsList.Add(queAns2);

                // Que 3
                QueAnsVO queAns3 = new QueAnsVO()
                {
                    QueID = randomNumber.Next(min, max),
                    Que = "Which of the following is not represented in correct unit?",
                    AnsA = "<img src=\"data:image/png;base64,\" alt=\"\" height=\"30\" width=\"87\" />",
                    AnsB = "Surface tension= N/m",
                    AnsC = "Energy= kg-m/sec",
                    AnsD = "Pressure= N/m<sup>2</sup>",
                    RightAnsEnum = Enums.RightAns.AnsC,
                    RightAnsExplaination = "Unit of energy will be kg-m<sup>2</sup>/sec<sup>2</sup> <br />",
                    StudentAnsState = Enums.StudentAnswerState.NotViewedYet
                };
                queAnsList.Add(queAns3);

                // Que 4
                QueAnsVO queAns4 = new QueAnsVO()
                {
                    QueID = randomNumber.Next(min, max),
                    Que = "A body of mass m is moving in a circle of radius r with a constant speed v. The force on the body is <img src=\"data:image/png;base64,\" alt=\"\" width=\"25\" height=\"20\" /> and is directed towards the centre. What is the work done by this force in moving the body over half thecircumference of the circle?",
                    AnsA = "<img src=\"data:image/png;base64,\" alt=\"\" height=\"30\" width=\"87\" />",
                    AnsB = "<img src=\"data:image/png;base64,\" alt=\"\" width=\"27\" height=\"23\" />",
                    AnsC = "<img src=\"data:image/png;base64,\" alt=\"\" width=\"28\" height=\"28\" />",
                    AnsD = "<img src=\"data:image/png;base64,\" alt=\"\" width=\"30\" height=\"30\" />",
                    RightAnsEnum = Enums.RightAns.AnsB,
                    RightAnsExplaination = "Work done by centripetal force is always zero",
                    StudentAnsState = Enums.StudentAnswerState.NotViewedYet
                };
                queAnsList.Add(queAns4);

                // Que 5
                QueAnsVO queAns5 = new QueAnsVO()
                {
                    QueID = randomNumber.Next(min, max),
                    Que = "Indenfity the molecules (a) and (b) shown below and select the right option giving their source and use<p> <img src=\"data:image/png;base64,\" alt=\"\" height=\"88\" width=\"214\" /></p><p> <img src=\"data:image/png;base64,\" alt=\"\" height=\"105\" width=\"308\" /></p>", 
                    AnsA = "<img src=\"data:image/png;base64,\" alt=\"\" height=\"79\" width=\"288\" />",
                    AnsB = "<img src=\"data:image/png;base64,\" alt=\"\" height=\"50\" width=\"286\" />",
                    AnsC = "<img src=\"data:image/png;base64,\" alt=\"\" height=\"52\" width=\"287\" />",
                    AnsD = "<img src=\"data:image/png;base64,\" alt=\"\" height=\"50\" width=\"287\" />",
                    RightAnsEnum = Enums.RightAns.AnsB,
                    RightAnsExplaination = "&nbsp; <br />",
                    StudentAnsState = Enums.StudentAnswerState.NotViewedYet
                };
                queAnsList.Add(queAns5);
            }

            return queAnsList;
        }
    }
}